import React from "react";
import Project from '../components/Project'

function Projects() {
  return (
    <div>
      <h1>This is the Projects page</h1>
      <Project text="React Project"/>
      <Project text="Senior Thesis"/>
      <Project text="Film"/>
    </div>
  );
};

export default Projects;
